ify.asmx\"},\"production_endpoints\":{\"url\":\"http:\\/\\/ws.cdyne.com\\/phoneverify\\/phoneverify.asmx\"}}</endpointConfig><inSequence></inSequence><testKey></testKey><endpointSecured>false</endpointSecured><endpointAuthDigest>false</endpointAuthDigest><tenants></tenants><endpointPpassword></endpointPpassword><wadl></wadl><technicalOwnerEmail></technicalOwnerEmail><implementation>ENDPOINT</implementation><apiOwner></apiOwner><transports>http,https</transports><deployments>null</deployments><keyManagers>[\"all\"]</keyManagers><businessOwner></businessOwner></overview><apiCategories><categoryName>adp-imported</categoryName></apiCategories><monetizationProperties>{}</monetizationProperties><URITemplate><authType0>Application &amp; Application User</authType0><urlPattern0>/*</urlPattern0><httpVerb0>POST</httpVerb0></URITemplate><isMonetizationEnabled>false</isMonetizationEnabled></metadata>',1),(711,_binary '<lifecycleHistory><item order=\"1\" user=\"adp_pub_user\" aspect=\"APILifeCycle\" state=\"Created\" targetState=\"Published\" originalPath=\"/_system/governance/apimgt/applicationdata/provider/adp_crt_user-AT-adpexample.com/ADPPhoneVerificationAPI/1.0.0/api\" timestamp=\"2025-12-27 11:44:39.041\"><action type=\"transition\" name=\"Publish\"><executors><executor name=\"org.wso2.carbon.apimgt.impl.executors.APIExecutor\"/></executors></action></item><item order=\"0\" user=\"adp_crt_user\" aspect=\"APILifeCycle\" state=\"Created\" originalPath=\"/_system/governance/apimgt/applicationdata/provider/adp_crt_user-AT-adpexample.com/ADPPhoneVerificationAPI/1.0.0/api\" timestamp=\"2025-12-27 11:44:34.527\"><action type=\"association\" name=\"\"/></item></lifecycleHistory>',1),(719,_binary 'schema {\n  query: Query\n  mutation: Mutation\n  subscription: Subscription\n}\n\n# The query type, represents all of the entry points into our object graph\ntype Query {\n  hero(episode: Episode): Character\n  reviews(episode: Episode!): [Review]\n  search(text: String): [SearchResult]\n  character(id: ID!): Character\n  droid(id: ID!): Droid\n  human(id: ID!): Human\n  allHumans(first: Int): [Human]\n  allDroids(first: Int): [Droid]\n  allCharacters(first: Int): [Character]\n  starship(id: ID!): Starship\n}\n\n# The mutation type, represents all updates we can make to our data\ntype Mutation {\n  createReview(episode: Episode, review: ReviewInput!): Review\n}\n\n# The subscription type, represents all subscriptions we can make to our data\ntype Subscription {\n  reviewAdded(episode: Episode): Review\n}\n\n# The episodes in the Star Wars trilogy\nenum Episode {\n  # Star Wars Episode IV: A New Hope, released in 1977.\n  NEWHOPE\n\n  # Star Wars Episode V: The Empire Strikes Back, released in 1980.\n  EMPIRE\n\n  # Star Wars Episode VI: Return of the Jedi, released in 1983.\n  JEDI\n\n  # Star Wars Episode III: Revenge of the Sith, released in 2005\n  SITH\n}\n\n# A character from the Star Wars universe\ninterface Character {\n  # The ID of the character\n  id: ID!\n\n  # The name of the character\n  name: String!\n\n  # The friends of the character, or an empty list if they have none\n  friends: [Character]\n\n  # The friends of the character exposed as a connection with edges\n  friendsConnection(first: Int, after: ID): FriendsConnection!\n\n  # The movies this character appears in\n  appearsIn: [Episode]!\n}\n\n# Units of height\nenum LengthUnit {\n  # The standard unit around the world\n  METER\n\n  # Primarily used in the United States\n  FOOT\n}\n\n# A humanoid creature from the Star Wars universe\ntype Human implements Character {\n  # The ID of the human\n  id: ID!\n\n  # What this human calls themselves\n  name: String!\n\n  # The home planet of the human, or null if unknown\n  homePlanet: String\n\n  # Height in the preferred unit, default is meters\n  height(unit: LengthUnit = METER): Float\n\n  # Mass in kilograms, or null if unknown\n  mass: Float\n\n  # This human\'s friends, or an empty list if they have none\n  friends: [Character]\n\n  # The friends of the human exposed as a connection with edges\n  friendsConnection(first: Int, after: ID): FriendsConnection!\n\n  # The movies this human appears in\n  appearsIn: [Episode]!\n\n  # A list of starships this person has piloted, or an empty list if none\n  starships: [Starship]\n}\n\n# An autonomous mechanical character in the Star Wars universe\ntype Droid implements Character {\n  # The ID of the droid\n  id: ID!\n\n  # What others call this droid\n  name: String!\n\n  # This droid\'s friends, or an empty list if they have none\n  friends: [Character]\n\n  # The friends of the droid exposed as a connection with edges\n  friendsConnection(first: Int, after: ID): FriendsConnection!\n\n  # The movies this droid appears in\n  appearsIn: [Episode]!\n\n  # This droid\'s primary function\n  primaryFunction: String\n}\n\n# A connection object for a character\'s friends\ntype FriendsConnection {\n  # The total number of friends\n  totalCount: Int\n\n  # The edges for each of the character\'s friends.\n  edges: [FriendsEdge]\n\n  # A list of the friends, as a convenience when edges are not needed.\n  friends: [Character]\n\n  # Information for paginating this connection\n  pageInfo: PageInfo!\n}\n\n# An edge object for a character\'s friends\ntype FriendsEdge {\n  # A cursor used for pagination\n  cursor: ID!\n\n  # The character represented by this friendship edge\n  node: Character\n}\n\n# Information for paginating this connection\ntype PageInfo {\n  startCursor: ID\n  endCursor: ID\n  hasNextPage: Boolean!\n}\n\n# Represents a review for a movie\ntype Review {\n  # The movie\n  episode: Episode\n\n  # The number of stars this review gave, 1-5\n  stars: Int!\n\n  # Comment about the movie\n  commentary: String\n}\n\n# The input object sent when someone is creating a new review\ninput ReviewInput {\n  # 0-5 stars\n  stars: Int!\n\n  # Comment about the movie, optional\n  commentary: String\n\n  # Favorite color, optional\n  favorite_color: ColorInput\n}\n\n# The input object sent when passing in a color\ninput ColorInput {\n  red: Int!\n  green: Int!\n  blue: Int!\n}\n\ntype Starship {\n  # The ID of the starship\n  id: ID!\n\n  # The name of the starship\n  name: String!\n\n  # Length of the starship, along the longest axis\n  length(unit: LengthUnit = METER): Float\n\n  coordinates: [[Float!]!]\n}\n\nunion SearchResult = Human | Droid | Starship\n',1),(720,_binary '{\n  \"openapi\" : \"3.0.1\",\n  \"info\" : {\n    \"title\" : \"ADPStarWarsAPI\",\n    \"version\" : \"1.0.0\"\n  },\n  \"servers\" : [ {\n    \"url\" : \"/\"\n  } ],\n  \"security\" : [ {\n    \"default\" : [ ]\n  } ],\n  \"paths\" : { },\n  \"components\" : {\n    \"securitySchemes\" : {\n      \"default\" : {\n        \"type\" : \"oauth2\",\n        \"flows\" : {\n          \"implicit\" : {\n            \"authorizationUrl\" : \"https://test.com\",\n            \"scopes\" : {\n              \"adp-film-subscriber\" : \"ADP film subscriber\",\n              \"adp-admin\" : \"ADP admin\"\n            },\n            \"x-scopes-bindings\" : {\n              \"adp-admin\" : \"admin\",\n              \"adp-film-subscriber\" : \"\"\n            }\n          }\n        }\n      }\n    }\n  }\n}',1),(726,_binary '<lifecycleHistory><item order=\"0\" user=\"adp_crt_user\" aspect=\"APILifeCycle\" state=\"Created\" originalPath=\"/_system/governance/apimgt/applicationdata/provider/adp_crt_user-AT-adpexample.com/ADPStarWarsAPI/2.0.0/api\" timestamp=\"2025-12-27 11:44:42.719\"><action type=\"association\" name=\"\"/></item></lifecycleHistory>',1),(730,_binary '<metadata xmlns=\"http://www.wso2.org/governance/metadata\"><overview><redirectURL></redirectURL><environments>Production and Sandbox</environments><authorizationHeader></authorizationHeader><type>GRAPHQL</type><productionTps></productionTps><enableSchemaValidation>false</enableSchemaValidation><context>/t/adpexample.com/adp-swapi/2.0.0</context><sandboxTps></sandboxTps><versionType>context</versionType><th