ue=\"Regular_expression_policy\"/>\n    </log>\n    <property name=\"threatType\" expression=\"get-property(\'threatType\')\" value=\"SQL-Injection\"/>\n    <property name=\"regex\" expression=\"get-property(\'regex\')\" value=\".*\'.*|.*alter.*|.*alter \\s*table.*|.*alter\\s*view.*|\n    .*create\\s*database.*|.*create\\s*procedure.*|.*create\\s*schema.*|.*create\\s*table.*|.*create\\s*view.*|\n    .*delete\\s*from.*|.*drop\\s*database.*|.*drop\\s*procedure.*|.*drop\\s*table.*|.*select\\s*.*\\s*from.*|\n    .*truncate\\s*table.*|.*insert\\s*into.*\"/>\n    <property name=\"enabledCheckBody\" expression=\"get-property(\'checkBodyEnable\')\" value=\"true\"/>\n    <property name=\"enabledCheckHeaders\" expression=\"get-property(\'enabledCheckHeaders\')\" value=\"true\"/>\n    <property name=\"enabledCheckPathParams\" expression=\"get-property(\'enabledCheckPathParams\')\" value=\"true\"/>\n    <class name=\"org.wso2.carbon.apimgt.gateway.mediators.RegularExpressionProtector\"/>\n</sequence>\n',2),(900,_binary '<sequence xmlns=\"http://ws.apache.org/ns/synapse\" name=\"debug_in_flow\">\n    <log level=\"full\">\n        <property name=\"IN_MESSAGE\" value=\"IN_MESSAGE\"/>\n    </log>\n\n    <property name=\"msgID\" expression=\"get-property(\'MessageID\')\"/>\n\n    <log level=\"custom\">\n        <property name=\"Host\" expression=\"get-property(\'transport\', \'Host\')\"/>\n        <property name=\"Context\" expression=\"get-property(\'To\')\"/>\n        <property name=\"Http_Method\" expression=\"get-property(\'axis2\', \'HTTP_METHOD\')\"/>\n        <property name=\"Resource\" expression=\"get-property(\'axis2\', \'REST_URL_POSTFIX\')\"/>\n        <property name=\"Origin\" expression=\"get-property(\'transport\', \'Origin\')\"/>\n        <property name=\"Content-Type\" expression=\"get-property(\'transport\', \'Content-Type\')\"/>\n        <property name=\"Message_Id\" expression=\"get-property(\'msgID\')\"/>\n    </log>\n</sequence>',2),(901,_binary '<?xml version=